function Dijkstra(grid) {
    console.log(grid)
    const nodes = getNodes(grid)
    console.log(nodes)
    console.log(nodes[10])
}

function getNodes(grid) {
    const nodes = []
    for (let row of grid) {
        var currRow = row
        for(let col of grid) {
            var currNode = {
                row,
                col,
                isVisited: false,
                startNode: row == 10 && col == 5,
                endNode: row == 10 && col == 30
            }
        }
        currRow.push(currNode)
    }
    nodes.push(currRow)
    return nodes 
}

export default Dijkstra
